export default function ControlCard({ title }) {
  return (
    <div>
      <h1> {title} </h1>
      <button className="btn btn-success">Start</button>
      <button className="btn btn-warning"> Restart</button>
      <button className="btn btn-danger">Down</button>
    </div>
  );
}
